        <script>
"use strict";

var PLATFORM = "playrix";
var superApp = {
  pause: null,
  resume: null,
  resize: null,
  screenSize: null
};

function domReadyHandler() {
  window.removeEventListener("load", domReadyHandler);
  runGame();
}

function runGame() {
  if (runGame.launched) return;
  runGame.launched = true;

  if (window.SoundsManager) {
    SoundsManager.handleVisibilityChange = function (data) {
      if (data.hidden) {
        SoundsManager.pauseAll();
      } else {
        setTimeout(SoundsManager.resumeAll, 100);
      }
    };
  }

  Game.init();
  Game.on("post-message", sendMessage);
  Game.once("preloadComplete", sendMessage.bind(this, 'ready'));
  setupLocaleAndSounds();
  initSuperAppMethods();
  initAutostart();
  window.addEventListener("resize", fitLayout);
  window.addEventListener("orientationchange", fitLayout);
  setInterval(fitLayout, 100);
  fitLayout();
}

function initSuperAppMethods() {
  superApp.pause = Game.pause;
  superApp.resume = Game.resume;
  superApp.resize = resize;
  superApp.screenSize = screenSize;
}

function screenSize() {
  return {
    width: document.body.clientWidth,
    height: document.body.clientHeight
  };
}

function fitLayout() {
  var layoutParams = screenSize();
  if (layoutParams.height !== 0 || layoutParams !== 0) resize(layoutParams);
}

function resize(layoutParams) {
  var w = layoutParams.width;
  var h = layoutParams.height;

  if (w / h > 2.171875) {
    w = h * 2.171875;
  } else if (w / h < 0.46043) {
    h = w / 0.46043;
  }

  LayoutManager.fitLayout(w, h);
  document.body.style.width = "100%";
  document.body.style.height = "100%";
  Game.app.view.style.left = (layoutParams.width - w) / 2 + "px";
  Game.app.view.style.top = (layoutParams.height - h) / 2 + "px";
}

function assignCloseButton(sprite) {
  if (sprite instanceof Sprite) {
    var params = Game.parseGet();
    var cb = sendMessage.bind(this, "close");
    var visibility = true;
    if (params["closeBtn"]) visibility = params["closeBtn"] === "off" ? false : true;

    if (!visibility) {
      var autoRemove = function () {
        if (this.parent) {
          this.parent.removeChild(this);
          console.warn("'close button' is autoremoved!");
        }
      }.bind(sprite);

      sprite.on("added", autoRemove);
      autoRemove();
    } else {
      sprite.on("pointerdown", cb);
    }

    Object.defineProperty(sprite, "visible", {
      value: visibility,
      writable: false
    });
  } else {
    console.warn("Use 'Sprite' for close button");
  }
}

function setupLocaleAndSounds() {
  var params = Game.parseGet();

  if (window.I18 && CONFIG.I18) {
    var locale = CONFIG.I18.locale;
    if (window.getDeviceLang) locale = window.getDeviceLang;
    if (params["lang"]) locale = params["lang"];
    var supportedLocales = I18.getSupportedLocales(CONFIG.I18.strings);
    if (supportedLocales.indexOf(locale) < 0) locale = "en";
    I18.init(locale, CONFIG.I18.strings);
  }

  if (params["mute"] && params["mute"] === "on") SoundsManager.enabled = false;
}

function initAutostart() {
  var params = Game.parseGet();
  if (params["autoStart"] && params["autoStart"] === "off") Game.pause();
}

function sendMessage(message) {
  if (window.nativeInterface) {
    window.nativeInterface.postMessage(message);
  } else if (window.webkit) {
    window.webkit.messageHandlers.nativeInterface.postMessage(message);
  }

  console.log(message + " event fired");
}

function getRewards() {
  var params = Game.parseGet();
  var rewardsCount = 0;
  var param = "";
  var reward1 = "";
  var reward2 = "";

  if (params["reward1"]) {
    rewardsCount += 1;
    param = params["reward1"];
    reward1 = param.replace(/\D+/g, " ");
  }

  if (params["reward2"]) {
    rewardsCount += 1;
    param = params["reward2"];
    reward2 = param.replace(/\D+/g, " ");
  }

  console.log("----------Rewards----------");
  console.log("count: " + rewardsCount);
  console.log("reward1: " + params["reward1"]);
  console.log("reward2: " + params["reward2"]);
  console.log("---------------------------");
  return {
    rewardsCount: rewardsCount,
    crystals: reward1,
    coins: reward2
  };
}

window.addEventListener("load", domReadyHandler);
</script>
